description:
Get the latest version now

- You can add any server to your favorites.
- You can find the servers on the Internet. It works!!!
- All the important files are protected from being changes.
- You can join any server (protocol 47/48)
- You will have a unique SteamID 

Run the installer, select the folder and install the game. Enjoy!


VERY IMPORTANT: Before joining any server read the instructions on how to protect your config.cfg


